// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Components
import Header from './components/Header';
import Home from './pages/Home';

// Placeholder Pages
// const Home = () => <div className="min-h-screen flex items-center justify-center text-2xl">Home Page</div>;
// const Shop = () => <div className="min-h-screen flex items-center justify-center text-2xl">Shop Page</div>;
// const ProductDetails = () => <div className="min-h-screen flex items-center justify-center text-2xl">Product Details Page</div>;
// const Cart = () => <div className="min-h-screen flex items-center justify-center text-2xl">Cart Page</div>;
// const Login = () => <div className="min-h-screen flex items-center justify-center text-2xl">Login Page</div>;
// const Register = () => <div className="min-h-screen flex items-center justify-center text-2xl">Register Page</div>;
// const Profile = () => <div className="min-h-screen flex items-center justify-center text-2xl">Profile Page</div>;
// const Checkout = () => <div className="min-h-screen flex items-center justify-center text-2xl">Checkout Page</div>;

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/product/:id" element={<ProductDetails />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/checkout" element={<Checkout />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/profile" element={<Profile />} />
      </Routes>
      <ToastContainer position="top-right" autoClose={3000} />
    </Router>
  );
}

export default App;
